func threeSum(nums []int) [][]int {
	ansHash := map[[3]int]int{}
	ch := make(chan int)
	for i, num := range nums {
		go func(nums []int, i, num, target int) {
			temp := map[int]int{}
			for j := i + 1; j < len(nums); j++ {
				if k, ok := temp[target-nums[j]]; ok && i != j && i != k && j != k {
					ans := [3]int{num, nums[k], nums[j]}
					sort.Ints(ans[:])
					ansHash[ans] = 1
				}
				temp[nums[j]] = j
			}
			ch <- 1
		}(nums, i, num, 0-num)
	}

	for t := 0; t < len(nums); t++ {
		<-ch
	}

	result := [][]int{}
	for ans := range ansHash {
		newSlice := make([]int, len(ans))
		copy(newSlice, ans[:])
		result = append(result, newSlice)
	}

	if len(result) == 0 {
		return nil
	}

	return result
}
